int luythua(int n)
{
    if (mu[n]) return mu[n];
    if (n == 0) return 1;
    return (mu[n] = luythua(n - 1) * 3);
}
bool check(int x, int y)
{
    for (int i = 0; i <= 9; i ++)
    {
        if (bitmask[x][i] == 0) continue;
        if (bitmask[x][i] == 1)
            if (bitmask[y][i] == 2 || (i && bitmask[y][i - 1] == 1)) return 0;
        if (bitmask[x][i] == 2)
            if (bitmask[y][i] == 1 || (i < 9 && bitmask[y][i + 1] == 2)) return 0;
    }
    return 1;
}
void gen(int z) {
    if (dd[z]) return;
    for(int i = 0; i <= 9; i ++) bitmask[z][i] = bitmask[z - 1][i];
    bitmask[z][0] ++;
    for (int i = 0; i < 9; i ++) {
        if (bitmask[z][i] > 2) {
            bitmask[z][i + 1] ++;
            bitmask[z][i] -= 3;
        }
        if (bitmask[z][i]) builtin[z] ++;
    }
    dd[z] = 1;
}
int sol(int n, int m)
{
    //n <= 10 <= m
    if (n == 7) return res7[m - 7];
    if (n == 8) return res8[m - 8];
    if (n == 9) return res9[m - 9];
    if (n == 10) return res10;
    for (int i = 1; i < luythua(n); i ++)
        gen(i);
    for (int x : tt){
        if (x >= luythua(n)) break;
        dp[1][x] = builtin[x];
    }
    for (int i = 2; i <= m; i ++)
        for (int x : tt)
        {
            if (x >= luythua(n)) break;
            for (int y : tt)
            {
                if (y >= luythua(n)) break;
                if(check(x, y))
                if (dp[i - 1][y] + builtin[x] > dp[i][x]) {
                    dp[i][x] = dp[i - 1][y] + builtin[x];
                }
            }
        }
    int res = 0;
    for (int x : tt)
    {
        if (x >= luythua(n)) break;
        if (dp[m][x] > res)
            res = dp[m][x];
    }
    return res;
}
 
 
